import React, { Component } from 'react';

import './App.css';

const Intro = (props) => (
        <p className="App-intro">
             Our first functional component
          </p>
)

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Tv series List</h1>
        </header>
         <Intro /> 

      </div>
    );
  }
}

export default App;
